import "./App.css";
import Header from "./components/Header";

function App() {
  const rewards = ["Demos", "Drinks", "Donny tells us a story", "R&D", "Celebrate"];
  return (
    <div className="App">
      <Header />
      <Spinner items={rewards} />
    </div>
  );
}

export default App;
